from pysat.solvers import Glucose3
import heapq
from itertools import count
import time
from helper_function import all_true_clauses, assignment_to_model, fill_value_to_unit_clauses, select_most_frequent_variable, contain_false_clause, get_variables
def solve_with_pysat(clauses):
    """
    Giải bài toán SAT cho công thức CNF sử dụng thư viện PySAT và solver Glucose3.
    """
    with Glucose3(bootstrap_with=clauses) as solver:
        if solver.solve():
            return solver.get_model()
        else:
            return None
        

def heuristic(variables, assignment):
    """
    Hàm heuristic: ước tính số biến chưa được gán.
    """
    return len(variables) - len(assignment)

def astar_CNF(clauses,initial_assignment,variables):
    # Lấy ra các biến từ các mệnh đề trong CNF

    # Gán giá trị cho các mệnh đề đơn vị (nếu có)
    initial_assignment=fill_value_to_unit_clauses(clauses, initial_assignment)

    # Hàm g và h để tính toán chi phí, trong đó g là số biến đã gán và h là heuristic(số biên chưa gán)
    first_g=len(initial_assignment)
    first_h=heuristic(variables, initial_assignment)

    # Một state bao gồm giá trị f(g+h), g, và dictionary lưu trữ các biến đã gán giá trị
    tie_breaker = count()
    initial_state=(first_g+first_h,next(tie_breaker),first_g,initial_assignment)
    pq=[]

    
    heapq.heappush(pq,initial_state)


    while pq:
        # Lấy ra state có f nhỏ nhất
        f,_, g, assignment = heapq.heappop(pq)
        assignment=fill_value_to_unit_clauses(clauses,assignment)

        # Nếu đã gán giá trị đủ cho các biến, bắt đầu kiểm tra tính thỏa mãn
        if len(assignment)==len(variables):
            if all_true_clauses(clauses,assignment):
                return assignment_to_model(assignment)
            else:
                continue
        # Nếu có mệnh đề không thỏa mãn thì không mở rộng
        if contain_false_clause(clauses,assignment):
            continue

        new_variable=select_most_frequent_variable(clauses,assignment,variables)
        for value in[True, False]:
            # Gán giá trị mới cho biến được chọn
            new_assignment=assignment.copy()
            new_assignment[new_variable]=value
            # Điền giá trị cho các mệnh đề đơn vị
            new_assignment=fill_value_to_unit_clauses(clauses,new_assignment)
            # Tính giá trị h và g mới
            new_g=len(new_assignment)
            new_h=heuristic(variables,assignment)
            new_f=new_g+new_h
            heapq.heappush(pq, (new_f, next(tie_breaker), new_g, new_assignment))
    
    return None

       



